text:
"TAVIS SMILEY" FOR THURSDAY, MAY 4, 2023 on @KBLA1580
@MichaelSteele- political commentator, the former chair of the Republican National Committee and former Maryland lieutenant governor (the first Black lieutenant governor in Maryland) joins Tavis to unpack some of the top trending headlines in the news including: yet another mass shooting – this time in Atlanta – leaving one dead and several others in critical condition, why Republicans are upset that Biden is sending troops to the border ahead of the expected migrant surge, the impact of Trump’s rape case on his presidential bid, and more.

@DrJenHo - the daughter of a refugee father from China and an immigrant mother from Jamaica - and a leading expert in the field of race and ethnicity studies.  As we acknowledge and pay respect to
Asian American and Pacific Islander Heritage Month in this hour, Tavis is joined by Dr. Jennifer Ho. 

@DrTRunstedtler- author and award-winning scholar of African American history whose research focuses on the intersection of race, masculinity, labor, and sport - joins Tavis  to discuss her new book "Black Ball: Kareem Abdul-Jabbar, Spencer Haywood, and the Generation that Saved the Soul of the NBA" which offers a gripping history and corrective to the negative narratives that have surrounded the league
and its Black players for decades.

Shelley “Butch” Anthony - owner of the famous ThisIsIt! Southern Kitchen & BBQ empire, a beloved family-owned business that has become a staple of Southern cuisine - joins Tavis to share his story and to
talk about the art of barbecue, the legacy of Southern cuisine, and overcoming obstacles to achieve success as an entrepreneur. @ThisIsItBBQ

